import React from "react"

function Korisnik(props){
    return(
        <div id="idKorisnik">
            <p>Korisnicko ime: {props.user.korisnickoIme}</p>
            <p>Datum registracije: {props.user.datumRegistracije}</p>
            <p>Uloga: {props.user.uloga}</p>
        </div>
    )
}

export default Korisnik
